import React from 'react'
import { FaEdit, FaTrash } from 'react-icons/fa'
const List = ({list}) => {
  return  <div> {
        list.map((item,index)=>{
          <h4 key={index}>{item}</h4>
        })
        }
    </div>
}

export default List
